import styled from "styled-components";

const Chat_button = styled.button`

    font-family: Monteserrat-Bold;
    color: white;

    border-radius: 1.25em;
    background-color: #50B4BF;
    border: none;
    padding: 0.4375em 1.25em;
    font-size: 1em;
    line-height: 1.25em;

    margin-top: 0.5em;

    transition: 0.5s;

`

export { Chat_button }
